<!doctype html>
<html lang="en">
<head>

  <title>Inflation Helper</title>
  <style type="text/css">

    html {
      width: 100%;
      margin: 0;
    }

    }

    .gold {

    }

    .silver {
      color: #aeaeae;
    }

    .copper {

    }

    .checkbox {

      height: 14px;

    }

    .c-pointer {

    }

      width: 100%;
      text-align: center;
      border: 0;
    }

  <script type="text/javascript">
  (() => {
    const formatCurrency = (base) => {
      const gold = Math.trunc(base / 10000);
      const silver = Math.trunc((base - (gold * 10000)) / 100);
      const copper = Math.trunc(base - (gold * 10000) - (silver * 100));

      if (gold === 0 && silver === 0) {
        return `<span class="copper">${copper}<span class="small-text">c</span></span>`;
      }

      if (gold === 0) {
        return `<span class="silver">${silver}<span class="small-text">s</span></span> <span class="copper">${copper}<span class="small-text">c</span></span>`;
      }

      return `<span class="gold">${gold}<span class="small-text">g</span></span> <span class="silver">${silver}<span class="small-text">s</span></span> <span class="copper">${copper}<span class="small-text">c</span></span>`;
    };

    const formatPercent = (base) => {
      const percent = (base * 100).toFixed(2);

      return `${percent}<span class="small-text">%</span>`;
    };

    const renderPrices = () => {
      document.getElementById("gem-price").innerHTML = formatCurrency(state.prices["gems"].latestPrice);
      document.getElementById("gem-price-avg-inflation-rate-last-five-years").innerHTML = formatPercent(state.prices["gems"].avgInflationRates[4]);
      document.getElementById("gem-price-avg-inflation-rate-last-five-years").classList = "regular-text " + (state.prices["gems"].avgInflationRates[4] > 0 ? "blue" : "pink");
      document.getElementById("gem-price-avg-inflation-rate-last-four-years").innerHTML = formatPercent(state.prices["gems"].avgInflationRates[3]);
      document.getElementById("gem-price-avg-inflation-rate-last-four-years").classList = "regular-text " + (state.prices["gems"].avgInflationRates[3] > 0 ? "blue" : "pink");
      document.getElementById("gem-price-avg-inflation-rate-last-three-years").innerHTML = formatPercent(state.prices["gems"].avgInflationRates[2]);
      document.getElementById("gem-price-avg-inflation-rate-last-three-years").classList = "regular-text " + (state.prices["gems"].avgInflationRates[2] > 0 ? "blue" : "pink");
      document.getElementById("gem-price-avg-inflation-rate-last-two-years").innerHTML = formatPercent(state.prices["gems"].avgInflationRates[1]);
      document.getElementById("gem-price-avg-inflation-rate-last-two-years").classList = "regular-text " + (state.prices["gems"].avgInflationRates[1] > 0 ? "blue" : "pink");
      document.getElementById("gem-price-avg-inflation-rate-last-year").innerHTML = formatPercent(state.prices["gems"].avgInflationRates[0]);
      document.getElementById("gem-price-avg-inflation-rate-last-year").classList = "regular-text " + (state.prices["gems"].avgInflationRates[0] > 0 ? "blue" : "pink");
    };

    const setGemPrices = () => {
      const latest = gemPrices[gemPrices.length - 1];
        
      const avgPriceLastMonth = (offset) => {
        const dayDuration = 86400000;
        const monthDuration = 2628000000;

        let startLowerBound = new Date(new Date(latest[0]).toDateString()).getTime() - (monthDuration * (offset + 1));
        let startUpperBound = startLowerBound + dayDuration;
        let endLowerBound = new Date(new Date(latest[0]).toDateString()).getTime() - (monthDuration * offset);
        let endUpperBound = endLowerBound + dayDuration;
        
        let startIndex = -1;
        let endIndex = -1;

        while (startIndex === -1) {
          startIndex = gemPrices.findIndex(function (entry) {
            return entry[0] >= startLowerBound && entry[0] <= startUpperBound;
          });

          startLowerBound = startLowerBound - dayDuration;
          startUpperBound = startUpperBound - dayDuration;
        }

        while (endIndex === -1) {
          endIndex = gemPrices.findIndex(function (entry) {
            return entry[0] >= endLowerBound && entry[0] <= endUpperBound;
          });

          endLowerBound = endLowerBound - dayDuration;
          endUpperBound = endUpperBound - dayDuration;
        }

        const entries = gemPrices.slice(startIndex, endIndex);
        return entries.reduce((accumulator, entry) =>  (accumulator + entry[1]), 0) / entries.length;
      };

      const numberOfYears = 5;

      let avgPrices = [];
      for (let i = 0; i < (numberOfYears * 12 + 12); i++) {
          avgPrices[i] = avgPriceLastMonth(i);
      }

      let inflationRates = [];
      for (let j = 0; j < (avgPrices.length - 12); j++) {
          inflationRates[j] = (avgPrices[j] - avgPrices[j + 12]) / avgPrices[j + 12];
      }

      let avgInflationRates = [];
      for (let k = 0; k < numberOfYears; k++) {
          inflationRatesToConsider = inflationRates.slice(0, k * 12 + 12);
          avgInflationRates[k] = inflationRatesToConsider.reduce((accumulator, rate) =>  (accumulator + rate), 0) / inflationRatesToConsider.length;
      }

      state.prices["gems"] = {
        latestPrice: latest[1],
        avgInflationRates: avgInflationRates
      };

      renderPrices();
    };
    
    document.getElementById("refresh").onclick = setGemPrices;
